import React from 'react';
import Navigation from './Navigation';
import { Jumbotron } from 'react-bootstrap';

const Header = () => {
  return (
    <div>
    <Jumbotron fluid className="mb-0" style={{ height: '200px', backgroundImage: 'url("https://via.placeholder.com/1920x200")', backgroundSize: 'cover', backgroundPosition: 'center' }}>
      <h1 className="text-center text-white">Your Name</h1>
    </Jumbotron>
    <Navigation />
    </div>
  );
}

export default Header;
